import React, { Component } from 'react';
import AutoComplete from '../autocomplete';
import Bar from '../Charts/bar';
import Line from '../Charts/line';
import Table from '../Charts/table1';
import Pie from '../Charts/pie';
import Donut from '../Charts/donut';
import BarHorizontal from '../Charts/BarHorizontal';
import BarLine from '../Charts/Mix/BarLine'; 
import Loader from 'react-loader-spinner';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from "react-router-dom";
import { getChartData } from '../../actions/chart';
import Popover from './popover.js'
import { fileURLToPath } from 'url';
import Select from './select' ;
import "./subcontentStyle.css";
import MultiSelect from './multiselect2'
// import DatePicker from '../common/DateRangePicker' ; 
import DatePicker from '../common/DateRangePicker'
import "react-dates/initialize";
import "react-dates/lib/css/_datepicker.css";
// import Coverflow from '../coverflow' 


import {getChartDataFilters} from '../../actions/chart';


class Subcontent extends Component {
	constructor(props) {
        super(props);
        // this.handleLoad = this.handleLoad.bind(this);
		this.state = {
            showAddiontalFilters: [],
            filterObjectArray: [],
                showContent: 1,
                showPopOver: false,
                // imageUrl: "./img/undraw_questions_75e0.png",
                // msg : "Ask me Anything!!",
                visible:true,
                ShowoverallData: true,
                ShowEngagementData: false,
                ShowCustomerData: false,
                ShowPromotionsData: false,
                ShowMarketingData: false,
                ShowSalesData: false,
                ShowInventoryData: false,
                ShowSKUData: false,
                autoCompleteValue: '',
                mounted: false,
        }
}

componentDidMount() { 
    this.handleLoad();
 }

componentWillReceiveProps(nextProps) {

    // if(!this.nextProps.authReducer.isAuthenticated){
    //     this.nextProps.history.push('/')
    // }

        const { chartData } = nextProps.chartData;
        const { loading } = nextProps.chartData;

        console.log('Props Data', Object.keys(nextProps.errors));
        console.log('Props Data', nextProps);


        if (Object.keys(chartData).length == 0) {
            // console.log('inside failure', nextProps.chartData, nextProps.errors)
            if(nextProps.errors != undefined && Object.keys(nextProps.errors).length > 0){
                    // console.log('inside error')
                    this.setState({
                        showContent: 1,
                        imageUrl: "./img/undraw_feeling_blue_4b7q.png",
                        msg: "No data found , Try some other queries from suggetions"
                    })
            }
            else if(loading && Object.keys(nextProps.errors).length == 0){
                console.log('loading and no errors ----------------')
                this.setState({
                    showContent: 2,
                    msg: ''
                })
            }
            else{
                console.log('inside empty')
                this.setState({
                    showContent: 1,                
                    // imageUrl: "./img/undraw_questions_75e0.png",
                    // msg: "Ask me Anything!!"
                })
            }
        } else{
            // console.log('inside suceess')
            this.setState({
				showContent: 2
		    })
        } 
        //const { loading } = nextProps.chartData;
}

componentWillMount(){

    console.log('page mount ----------------------------')
    let payload ={
        "entry": [
        {
            "messaging": [
                {
                    "timestamp": 1551652552,
                    "message": {
                        "text": "",
                         "filters": {}
                    },
                    "recipient": {
                        "id": ""
                    },
                    "sender": {
                        "id": ""
                    }
                }
            ],
            "id": "",
            "time": 16266262
        }
    ],
    "object": "page"
}
    this.props.getChartDataFilters(payload);

}

// componentDidMount() {
//     this.blinkFunction
// }


showDataAfterFilters = (filterName, value, query)=>{
    let totalAppliedFilters = {};
    // this.state.filterObject[filterName] = value;
    let filterObjectArray = this.state.filterObjectArray;
    filterObjectArray.push({
        [filterName] : value
    });
    this.setState({
        filterObjectArray: filterObjectArray
    })

    filterObjectArray.map((filter)=>{
        for(var key in filter){
            totalAppliedFilters[key] = filter[key];
        }
    })

    console.log('ppppppppppppppppppppppppsssssssssss', totalAppliedFilters);

    let payload = {
        "entry": [
            {
